import React from 'react';
import './Learning.module.css';
import NavTop from '../NavTop/NavTop';

const Learning = () => {
  return (
  <>
    <NavTop/>
    <div className="nav-link">Learning</div>;
    <NavBottom/>
  </>
  );  
};

export default Learning;
